interface iTestimonials {
    id: number;
    name: string;
    message: string;
}

let testimonials: iTestimonials[] = [
    {
        id: 1,
        name: "Jack Kemsley",
        message: "Brilliant service! Would highly recommend!!"
    },
    {
        id: 2,
        name: "Hannah Crouch",
        message: "Has done work for myself and for friends very pleased with the outcome greate prices great work recommended highly give him a message he's absolutely brilliant"
    },
    {
        id: 3,
        name: "Jessica Fryer",
        message: "David was on time and did a fantastic job and the outcome was greate. I would recommend him"
    }
];



function TestimonalCard(testimonials: iTestimonials) {
    return (
        <div>
            <div>
                <p>
                    <span>&ldquo;</span>
                    {testimonials.message}
                </p>
                <p>
                    {testimonials.name}
                </p>
            </div>
        </div>
    )
}

function cards(testimonials: iTestimonials) {
    return (
        <TestimonalCard
            id={testimonials.id}
            name={testimonials.name}
            message={testimonials.message}
        />
    )
}

export default cards
